import React from 'react'
import Navbar from './Navbar';
import { Routes, Route } from 'react-router-dom'
import App from '../App'

function HomePage() {
  return (
    <div className="App-Home">
      <Navbar />
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="/dashboard" element={<HomePage />} />
      </Routes>
    </div>
  )
}

export default HomePage
